def transform(sequence):
    sequence = list(map(int, str(sequence)))
    for i in range(len(sequence)):
        if sequence[i] != 0:
            temp = sequence[i]
            sequence[i] = 0
            sequence[sequence.index(0, i+1)] = temp
    return int("".join(map(str, sequence)))
